import ContactForm from './form';

const Contact = () => {
    return (
        <main>
            <div className='contact'>
                <h1>Kontakt</h1>
                <p>HIerIch werde mich </p>
                <ContactForm />
            </div>
        </main>
    );
};

export default Contact;
